import React from "react";
import "./style.css";

export default function Confirmation() {
  return (
    <div className="confirm_wrapper">
      <div className="confirm_label">
        <img
          style={{ width: "70px" }}
          src="https://upload.wikimedia.org/wikipedia/commons/5/50/Yes_Check_Circle.svg"
          alt="green check"
        />
        <span style={{ fontSize: "30px" }}>Thank you for your order!</span>
      </div>
      <div className="confirm_box"></div>
    </div>
  );
}
